import React, { Component } from "react";
import logo from "./images/menu-top.svg";

class Header extends Component {
    render() {
        return (
            <header className="header">
                <img src={logo} width="100px"/>
                <p>heie</p>
            </header>
        );
    }
}

export default Header;
